	studentid, surname, firstname, othernames, departmentid, accountnumber)
SELECT 'CHRI', 0, 'M', 'S', 'NG', 'NG', 'NG', 39,
	'NU/' || lpad(CAST(new_students.new_student_id as varchar), 4, '0'), 
	new_students.last_name, new_students.first_name, new_students.middle_name,
	majors.departmentid, new_students.acct_no
FROM new_students INNER JOIN majors ON trim(upper(new_students.degree_code)) = trim(upper(majors.majorid));

SELECT 'B.A', 'NU/' || lpad(CAST(new_students.new_student_id as varchar), 4, '0'), 
	'UNDM', 3, 0
FROM new_students ;


SELECT studentdegrees.studentdegreeid, new_students.degree_code, 0
FROM new_students INNER JOIN studentdegrees ON studentdegrees.studentid = ('NU/' || lpad(CAST(new_students.new_student_id as varchar), 4, '0'));


UPDATE students SET firstpasswd = first_password() WHERE firstpasswd is null;


	primary_email, function_role, first_password, entity_password)
SELECT students.org_id, 21, students.studentname, students.studentid, 
	students.emailuser || '@std.babcock.edu.ng', 
	'student', students.firstpasswd, md5(students.firstpasswd)
FROM students LEFT JOIN entitys ON students.studentid = entitys.user_name
WHERE (entitys.user_name is null);



